import React from 'react';
import { Panel, PanelHeader, Text, Group, TextTooltip, View, Div, CardGrid, Card, Header, Spacing } from '@vkontakte/vkui';

import '@vkontakte/vkui/dist/vkui.css';

const MessageComp = (props) => {

    return (

        <View activePanel="test">
            <Panel id="test">
                <Group mode="plain" header={<Header mode="secondary">{props.message.sender_name}</Header>}>
                    <CardGrid size="l">
                        <Card mode="outline">
                            <Text>{props.message.text}</Text>
                        </Card>
                        <Spacing size={160} />
                    </CardGrid>
                </Group>
            </Panel>
        </View>
    );
};

export default MessageComp;
